import { FontAppType } from '@const/TypeFontFamily';
import { ImagesRenderSize } from '@element/AppImageRenderSize';
import { SizeRpScreen } from '@resources/ResponsiveScreen';
import React, { useState, useRef, useEffect } from 'react';
import { StyleSheet } from 'react-native';
import { TouchableOpacity, View, Text } from 'react-native';


const AppImagesRenderSizeElementReuse = () => {

    const arrImgTest = [
        { id: 1, url: "data:image/jpeg;base64," },
        { id: 2, url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ7bxDQ9_JqDv9D3Bx55Siww1jtekUdaE3GaQ&usqp=CAU" },
        { id: 3, url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRKxD4yfnJKQGlp8es9KFTxh2Wg27EnOIb9ow&usqp=CAU" },
        { id: 4, url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSKu3sq669MN34ICAf5g0BBOXTINYMUk6fs_g&usqp=CAU" },
        { id: 5, url: "data:image/jpeg;base64," },
    ]
    const [imgCurrent, setStateUrlCurrent] = useState(arrImgTest[0]);
    const indexCurrent = useRef(0);
    useEffect(() => {
        console.log("indexCurrent.current", indexCurrent.current);
        console.log("imgCurrent", imgCurrent.url);
        return () => {
        };
    }, [indexCurrent.current]);

    const countIndex = (keyActions) => () => {
        switch (keyActions) {
            case "down":
                if (indexCurrent.current > 0) {
                    indexCurrent.current = indexCurrent.current - 1;
                    setStateUrlCurrent(arrImgTest[`${indexCurrent.current}`])
                }
                break;
            case "up":
                if (indexCurrent.current < arrImgTest.length - 1) {
                    indexCurrent.current = indexCurrent.current + 1;
                    setStateUrlCurrent(arrImgTest[`${indexCurrent.current}`])
                }
                break;
        }
    }


    return (
        <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
            <ImagesRenderSize
                scaleConvert={1}
                uriImgRenderSize={imgCurrent.url}
            >
            </ImagesRenderSize>
            <View style={{ flexDirection: "row", height: 50, width: SizeRpScreen.device_width, marginTop: 45 }}>
                <TouchableOpacity
                    onPress={countIndex("down")}
                    style={{ flex: 1, backgroundColor: "green", justifyContent: "center" }}>
                    <Text style={{ textAlign: 'center', fontSize: 20, fontWeight: "bold", color: "white" }}>BACK</Text>
                </TouchableOpacity>
                <TouchableOpacity
                    onPress={countIndex("up")}
                    style={{ flex: 1, backgroundColor: "blue", justifyContent: "center" }}>
                    <Text style={{ textAlign: 'center', fontSize: 20, fontWeight: "bold", color: "white" }}>NEXT</Text>
                </TouchableOpacity>
            </View>

        </View>
    );
}

const styles = StyleSheet.create({
    appText: {
        fontSize: 35,
        fontFamily: FontAppType.Happy,
        textAlign: 'center'
    }
})

export { AppImagesRenderSizeElementReuse };

